import React from 'react';
import dogsdata from "../dogsdata";

const DetailDogs = ({match}) => {
    const {id} = match.params;
    const secilen = dogsdata.find(secilen => secilen.id === id)

    return(
        <div>
            <img src={secilen.image} alt="dog"></img>
           Dog ID: {id} <br/>
           Dog Name: {secilen.name}<br/>
           Dog Age: {secilen.age}<br/>
           Dog Breed: {secilen.breed}<br/>
           Description {secilen.description}<br/>
           Published: {secilen.published_at}<br/>
        </div>
    )
}





export default DetailDogs;
